INSERT INTO `ArcaImporterInstances` VALUES (1,'Products','Products List','SELECT AR.Id_Ar, AR.Cd_AR, AR.Descrizione, AR.DescrizioneBreve, AR.PesoNetto\nFROM AR\nWHERE AR.Cd_AR like \'0%\';','Prodotto'),(2,'CommercialProducts','Commercial Product List','SELECT Parent.Cd_AR as ProdottoCommerciale, Child.Cd_AR as Prodotto, Parent.Descrizione as Descrizione, Parent.DescrizioneBreve as DescrizioneBreve FROM AR as Parent INNER JOIN DB ON (Parent.Cd_AR = DB.Cd_AR)\r\n	INNER JOIN DBMateriale DBM ON (DB.Id_DB = DBM.Id_DB)\r\n	INNER JOIN AR as Child ON (Child.Cd_AR = DBM.Cd_AR)\r\n  where Parent.Cd_AR like \'P%\' AND LEN(Parent.Cd_AR) = 5AND (DB.FineValidita is null or DB.FineValidita > GETDATE())','ProdottoCommercialeProdotto'),(3,'Customers','Customers List','SELECT C.Id_CF, Cd_CF, C.Descrizione, C.Indirizzo, C.Localita, C.Cd_Provincia, C.Cd_NazioneProvincia, C.Cap, C.PartitaIva, C.CodiceFiscale, C.Telefono, C.Fax, C.Email, C.Email_Amministrazione, C.URL FROM CF C WHERE C.Cliente = 1;','Cliente'),(4,'Suppliers','Suppliers List','SELECT C.Id_CF, Cd_CF, C.Descrizione, C.Indirizzo, C.Localita, C.Cd_Provincia, C.Cd_NazioneProvincia, C.Cap, C.PartitaIva, C.CodiceFiscale, C.Telefono, C.Fax, C.Email, C.Email_Amministrazione, C.URL FROM CF C WHERE C.Cliente = 0;','Fornitore'),(5,'Articles','Articles List','SELECT A.Id_AR, A.Cd_AR, A.Descrizione, A.DescrizioneBreve FROM AR A WHERE A.Cd_AR not like \'0%\'','Articolo');
/*!40000 ALTER TABLE `ArcaImporterInstances` ENABLE KEYS */;
