CREATE DEFINER=`root`@`localhost` PROCEDURE `GET_PN_ASSEMBLY_DETAILS`(PNInput VARCHAR(10))
BEGIN
	SELECT 	A.ID as IDAssemblaggio, 
			PF.SN, P.Cd_AR, 
            P.Descrizione, 
            R.PN, 
            A.DateTime, 
            O.Nome, 
            O.Cognome
	FROM Assembly A
		INNER JOIN ProdottoFinito PF ON PF.ID = A.IDProdottoFinito
        INNER JOIN Product P ON PF.Product = P.Id_AR
        INNER JOIN PNRighe R ON A.IDPN = R.ID
        INNER JOIN Operatore O ON A.IDOperatore = O.ID
	WHERE IDPN = (SELECT ID FROM PNRighe WHERE PN = PNInput);
END ;;
