CREATE DEFINER=`root`@`localhost` PROCEDURE `insertPN_Header`(
							TipoDocumento VARCHAR(10),
							DataDocumento DATE, 
                            NrDocumento VARCHAR(45), 
                            DocInt VARCHAR(255), 
                            NoteInt VARCHAR(255),
                            IDF INT,
                            Operatore INT)
BEGIN

	IF NOT EXISTS(SELECT * FROM PNDocumento D 
					INNER JOIN Fornitore F ON D.IDFornitore = F.`Id_CF`
					WHERE D.DataDoc = DataDocumento
                    AND D.NrDoc = NrDocumento
                    AND F.`Id_CF` = IDF )
	THEN 
		
		INSERT INTO PNDocumento(TipoDoc,DataDoc, NrDoc, IDFornitore) 
			VALUES(TipoDocumento, DataDocumento, NrDocumento,IDF);
            
		
	
		
	END IF;
    
    INSERT INTO PNTestata(DataReg, DocumentoInterno, Note, IDPNDocumento,IDOperatore)
		VALUES(Now(), DocInt, NoteInt, (SELECT D.ID FROM PNDocumento D 
											INNER JOIN Fornitore F ON D.IDFornitore = F.`Id_CF`
											WHERE D.DataDoc = DataDocumento
											AND D.NrDoc = NrDocumento 
											AND F.`Id_CF` = IDF 
										), Operatore);
	
    SELECT LAST_INSERT_ID() as IDTestata;
END ;;
