CREATE DEFINER=`root`@`localhost` PROCEDURE `insertPn_Loop`(startPn INT, qtyPN INT,IDDoc INT, IDGrpF INT)
BEGIN
	DECLARE i INT DEFAULT 0;
    DECLARE defaultPn VARCHAR(10) DEFAULT '0100000000';
    DECLARE counter INT DEFAULT startPn;
    DECLARE lenCounter INT DEFAULT 0;
    DECLARE pn VARCHAR(10) DEFAULT '';
    WHILE i < qtyPN DO
		SET lenCounter = LENGTH(counter);
        SET pn = CONCAT(left(defaultPn,10-lenCounter),CONVERT(counter,char));
        INSERT INTO PNRighe (PN, IDDocumento, IDGrpF ) VALUES (pn, IDDoc, IDGrpF);
        SET counter = counter + 1;
        SET i = i+1;
    END WHILE;
END ;;
DELIMITER ;
