CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_or_update`(modPackage INT, oldSerialNumber VARCHAr(10), serialNumber VARCHAR(10))
BEGIN
IF NOT EXISTS(SELECT * FROM ProdottoFinito PF WHERE PF.SN = serialNumber)
	THEN 
    
    INSERT INTO ProdottoFinito(SN, Product) VALUES(serialNumber,(SELECT Id_Ar FROM Product WHERE MID(Product.Cd_Ar,2,5) = LEFT(serialNumber,5)));
END IF;
UPDATE Imballo I, ProdottoFinito PF 
	SET I.PF = (SELECT PrF.ID FROM ProdottoFinito PrF WHERE PrF.SN = serialNumber )
    WHERE I.Package = modPackage and I.PF = (SELECT PrF.ID FROM ProdottoFinito PrF WHERE PrF.SN = oldSerialNumber );
END ;;
