CREATE DEFINER=`root`@`localhost` PROCEDURE `PK_INSERT_PK_SN`(IDSERVERPK INT,PROGPK INT, IDSERVERSESSIONE Int, PROGRESSIVOSESSIONE INT, SN1 CHAR(10), OUT INT_RETURN INT)
BEGIN
		
			DECLARE EXIT HANDLER FOR SQLEXCEPTION  
            BEGIN
				
                SET INT_RETURN = 1;
                ROLLBACK;
			END;
            
            DECLARE EXIT HANDLER FOR SQLWARNING
            BEGIN
				
                SET INT_RETURN = 2;
                ROLLBACK;
			END;
            
            START TRANSACTION;
            
				
				IF NOT EXISTS(SELECT * FROM ProdottoFinito PF WHERE PF.SN = SN1)
					THEN
					
					SET @PFPROG = (SELECT MAX(PF.ProgressivoProdottoFinito)  + 1 
									FROM ProdottoFinito PF WHERE PF.IDServerProdottoFinito = IDSERVERPK);
                                    
					IF @PFPROG IS NULL THEN
						SET @PFPROG = 1;
					END IF;
                    
                    
					
					INSERT INTO ProdottoFinito(ProgressivoProdottoFinito,IDServerProdottoFinito,SN, Product,DateTime) 
						VALUES(@PFPROG,IDSERVERPK,SN1,(SELECT Id_Ar FROM Prodotto WHERE MID(Prodotto.Cd_Ar,2,5) = LEFT(SN1,5)), Now());
				END IF;
					
				
