CREATE DEFINER=`root`@`localhost` PROCEDURE `PL_ADD_NEW_CARTON`(IDSERVERPL INT,PROGPL INT,IDSERVERC INT, IDTIPOC INT)
BEGIN
	DECLARE tmpTable VARCHAR(45) DEFAULT 'sampleTable';
    DROP TABLE IF EXISTS tmpTable;
    
	CREATE TEMPORARY TABLE tmpTable
	SELECT count(*) as NrCollo
	FROM PLCollo C 
		left JOIN PLColloPackingList PLC ON (C.IDServerCollo = PLC.IDServerCollo AND C.ProgressivoCollo = PLC.ProgressivoCollo)
	WHERE PLC.IDServerPackingList = IDSERVERPL 
		AND PLC.ProgressivoPackingList = PROGPL ;
	
    
	INSERT INTO PLCollo(IDServerCollo, NrCollo, IDTipoCollo) VALUES(IDSERVERC,(
		SELECT (NrCollo + 1) as newcollo from tmpTable)
        , IDTIPOC); 
    INSERT INTO PLColloPackingList(IDServerCollo,ProgressivoCollo,IDServerPackingList,ProgressivoPackingList) VALUES (IDSERVERC,(SELECT LAST_INSERT_ID()),IDSERVERPL,PROGPL);    
END ;;
