CREATE DEFINER=`root`@`localhost` PROCEDURE `PL_GET_ALL_CARTONS_DETAILS`(IDPL VARCHAR(25))
BEGIN
	SELECT C.IDCollo, C.NrCollo, A.Id_AR as IDArticolo, A.Cd_AR as CodiceArticolo,
		A.Descrizione as Descrizione, C.PesoLordoCollo, CP.nPackage 
FROM PLCollo C
	INNER JOIN PLColloPackingList PLC ON
	C.IDCollo = PLC.IDCollo 
	INNER JOIN TipoCollo  T ON
	T.IDTipoCollo = C.IDTipoCollo
	INNER JOIN Articolo A ON A.Id_AR = T.IDArticolo
	INNER JOIN (
		SELECT IDCollo,Count(*) as nPackage
		FROM PLColloPackage PKC GROUP BY IDCollo) CP 
		ON CP.IDCollo = C.IDCollo
WHERE PLC.IDPackingList = IDPL;
END ;;
